CREATE TABLE pharmacy (
    `vdl` INT,
    `rating` VARCHAR(3) NOT NULL CHARACTER SET utf8,
    `retezec` VARCHAR(50) CHARACTER SET utf8,
    `nazev` VARCHAR(70) CHARACTER SET utf8,
    `ulice` VARCHAR(50) CHARACTER SET utf8,
    `mesto` VARCHAR(50) CHARACTER SET utf8,
    `okres` VARCHAR(50) CHARACTER SET utf8,
    PRIMARY KEY (vdl)
);
